    Free(internal->initial_E2);
    Free(internal->initial_I);
    Free(internal->initial_R);
    Free(internal->initial_S);
    Free(internal->lambda);
    Free(internal->m);
    Free(internal->mix_mat_set);
    Free(internal->n_EE);
    Free(internal->n_EI);
